Conditions:
TM835: (Taric Measure) The frequency of physical checks carried out by the Member States shall be significantly reduced provided that the consignments are accompanied by the following documents:
(a) the results of sampling and analysis performed by a USDA approved laboratory carried out in accordance with or equivalent to the provisions of Commission Regulation (EC) No 401/2006 of 23 February 2006 laying down the methods of sampling and analysis for the official control of mycotoxins in foodstuffs (TARIC certificate code C692); 
(b) a certificate in accordance with the model set out in the Annex II of Commission Implementing Regulation (EU) 2015/949, completed, signed and verified by an authorised representative of the USDA for foodstuffs from the United States of America (TARIC certificate code C684).

